{
  "extends": ["@commitlint/config-conventional"]
}

export default {
  '**/*.{ts,js,tsx,jsx,mjs,json,md,mdx,scss,html,yml}': f =>
    `yarn nx format:write --files=${f.join(',')}`,
  '**/*.{ts,tsx,js,jsx}': 'eslint'
};

{
  "gitbook": "3.x.x",
  "title": "NGXS",
  "root": "/docs",
  "plugins": ["highlight", "github", "include-codeblock", "versions", "anchors", "youtube"],
  "pluginsConfig": {
    "github": {
      "url": "https://github.com/ngxs/store/"
    },
    "versions": {
      "type": "branches"
    }
  }
}

import { defineConfig } from 'cypress';

const isSsr = process.env.SSR === 'true';

export default defineConfig({
  video: false,
  screenshotOnRunFailure: false,
  responseTimeout: 60000,
  pageLoadTimeout: 120000,
  e2e: {
    supportFile: false,
    // We've imported your old cypress plugins here.
    // You may want to clean this up later by importing these.
    setupNodeEvents(on, config) {
      return require('./cypress/plugins/index.js')(on, config);
    },
    baseUrl: 'http://localhost:4200',
    excludeSpecPattern: ['**/plugins/**.js', '**/tsconfig.json'],
    specPattern: isSsr ? './cypress/ssr/*.ts' : './cypress/e2e/*.ts'
  }
});

const { getJestProjects } = require('@nx/jest');

globalThis.ngJest = {
  skipNgcc: true
};

module.exports = {
  projects: getJestProjects()
};

const nxPreset = require('@nx/jest/preset').default;
const { pathsToModuleNameMapper } = require('ts-jest');

const { compilerOptions } = require('./tsconfig.base.json');

module.exports = {
  ...nxPreset,
  testMatch: ['**/+(*.)+(spec|test).+(ts|js)?(x)'],
  transform: {
    '^.+.(ts|mjs|js|html)$': 'jest-preset-angular'
  },
  testPathIgnorePatterns: ['/node_modules/', '/types/', '/helpers/'],
  transformIgnorePatterns: ['node_modules/(?!.*\\.mjs$)'],
  resolver: '@nx/jest/plugins/resolver',
  moduleFileExtensions: ['ts', 'js', 'html'],
  coverageReporters: ['json', 'lcovonly', 'lcov', 'text', 'html'],
  moduleNameMapper: pathsToModuleNameMapper(compilerOptions.paths, {
    prefix: process.cwd()
  })
};

