{
  "rangeStrategy": "bump",
  "separateMajorMinor": false,
  "timezone": "UTC",
  "baseBranches": ["master"],
  "ignoreDeps": ["@types/node"],
  "automerge": true,
  "packageFiles": ["package.json", "packages/**/package.json"],
  "major": {
    "devDependencies": {
      "enabled": false
    }
  },
  "packageRules": [
    {
      "extends": ["monorepo:angular", "monorepo:angularcli"],
      "groupName": "@angular",
      "schedule": ["before 3am on the first day of the month"]
    },
    {
      "packageNames": ["typescript"],
      "groupName": "typescript",
      "updateTypes": "patch",
      "schedule": ["before 3am on the first day of the month"]
    },
    {
      "packagePatterns": ["*"],
      "excludePackageNames": ["typescript"],
      "groupName": "all dependencies",
      "groupSlug": "all",
      "schedule": ["before 3am on the first day of the month"]
    }
  ]
}

import { dts } from 'rollup-plugin-dts';

import { getEntryPointsAndDtsToRemove } from './build/collect-dts.mjs';

export default getEntryPointsAndDtsToRemove().entryPoints.map(entryPoint => ({
  input: entryPoint,
  output: [{ file: entryPoint, format: 'es' }],
  plugins: [dts()]
}));

import { TextDecoder, TextEncoder } from 'node:util';

Object.assign(global, { TextDecoder, TextEncoder });

import 'jest-preset-angular/setup-jest';

const CI = process.env['CI'] === 'true';

/**
 * GLOBAL MOCKS
 */

Object.defineProperty(window, 'CSS', { value: null });
Object.defineProperty(document, 'doctype', {
  value: '<!DOCTYPE html>'
});

Object.defineProperty(window, 'getComputedStyle', {
  value: () => {
    return {
      display: 'none',
      appearance: ['-webkit-appearance']
    };
  }
});

/**
 * ISSUE: https://github.com/angular/material2/issues/7101
 * Workaround for JS DOM missing transform property
 */
Object.defineProperty(document.body.style, 'transform', {
  value: () => {
    return {
      enumerable: true,
      configurable: true
    };
  }
});

if (CI) {
  const consoleMethods: string[] = [
    'trace',
    'debug',
    'warn',
    'log',
    'group',
    'groupCollapsed'
  ];

  consoleMethods.forEach((methodName: string) => {
    jest.spyOn(global.console, methodName as any).mockImplementation(() => jest.fn());
  });
}

